import React from "react";

import PlaceList from '../components/PlaceList';

const DUMMY_PLACES= [
  {
    id: 'p1',
    title: 'Empire State Building',
    description: 'One of the most famous sky scrapers in the world!',
    imageURL: 'https://www.google.com/url?sa=i&url=https%3A%2F%2Favatars.alphacoders.com%2Favatars%2Fview%2F278689&psig=AOvVaw1q6npb1dCZy7NAMlrSuyvC&ust=1679431924978000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCLDZrsyx6_0CFQAAAAAdAAAAABAE',
    address: '20 W 34th St., New York, NY 10001, United States',
    location: {
      lat:40.7484405, 
      lng:-73.9878531, 
    },
    creator: 'u1'
  },
  {
    id: 'p2',
    title: 'Empire State Building',
    description: 'One of the most famous sky scrapers in the world!',
    imageURL: 'https://www.google.com/url?sa=i&url=https%3A%2F%2Favatars.alphacoders.com%2Favatars%2Fview%2F278689&psig=AOvVaw1q6npb1dCZy7NAMlrSuyvC&ust=1679431924978000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCLDZrsyx6_0CFQAAAAAdAAAAABAE',
    address: '20 W 34th St., New York, NY 10001, United States',
    location: {
      lat:40.7484405, 
      lng:-73.9878531, 
    },
    creator: 'u2'
  }
];

const UserPlaces = () => {
  return <PlaceList items={DUMMY_PLACES}/>
};

export default UserPlaces;
